INSERT INTO `about` (`id`, `title`, `content`, `img`, `date`, `date_s`, `suspend`, `type`, `publisher`) VALUES
(1, 'مجموعة المملكة الطبية', '<p dir="RTL"><strong>إن المساهمة في تحسين صحة المريض هو ركيزة كل أعمالنا، ولذلك أصبحنا اليوم الخيار الأول في المنطقة للمستلزمات الطبية والعناية بالأسنان عناية متكاملة وعيادات التجميل ، فبالإضافة الى توفير أعلى المستويات لتقديم الحلول المتكاملة والموثوق بها لمراجعينا لذلك نقوم بتقديم مجموعة متنوعة من المنتجات والحلول الشاملة التي تمكّن الأخصائيين من التشخيص والعلاج على أكمل وجه</strong><strong><span dir="LTR">. </span></strong><br />\r\n<strong>وتتميز المنتجات بمواصفات السلامة وفق معايير صارمة ليتمكّن الاختصاصيون من تأدية العلاج بكل أمان وأصبحت مستلزماتنا مرجعاً لمعيار السلامة والجودة </strong><strong>.</strong></p>\r\n', '1c73e0e3880cf4526d7b1f95ef1f8992.jpg', 1489611600, 1489667199, 1, 3, '1'),
(2, 'خدماتنا ', '<p><strong>من أهم عوامل النجاح لأي منشأة هي بتوفر عنصر رئيسي وهام وهو وجود إدارة خبيرة ومتخصصة ، وهذا ما يميزنا عن غيرنا بتواجد عنصري الإدارة الإحترافية و نخبة من المختصين في التأهيل من ذوي الخبرة و الكفاءة ، ولا شك أن تواجدهم معنا يجعلنا نفخر بتقديم خدمات فائقة أبقتنا محط ثقة العديد من المختصين في المجال الطبي وغيرهم حتى أصبحنا اختيارهم الأول ،، ولله الحمد </strong></p>\r\n', 'e61d89247b8e5645e055361c2cf5b396.jpg', 1489611600, 1489673592, 1, 3, '1');
